import React from 'react';
import { Button, Icon, Link, PlusGrid, PlusGridItem, Socials } from '@app/components';
import { Utils } from '@app/utils';
import { HeaderProps } from './header.types';

export const Header: React.FC<HeaderProps> = (props) => {

  const { onMenuClick } = props;

  const classes = Utils.classes(
    'header'
  );

  return (
    <div className={classes}>
      <PlusGrid alignItems="center" gutter-x="md" wrap="off">
        <PlusGridItem xs="auto" hideLgUp>
          <Button icon onClick={onMenuClick}>
            <Icon name="menu" />
          </Button>
        </PlusGridItem>
        <PlusGridItem>
          <Link to="ROUTE:HOME">
            <img src="/assets/logo/logo.svg" width="135px" />
          </Link>
        </PlusGridItem>
        <PlusGridItem xs="grow" />
        <PlusGridItem>
          <Button size="xs">
            <Link to="ROUTE:FRAMEWORK:OVERVIEW">
              About
            </Link>
          </Button>
        </PlusGridItem>
        {/*<PlusGridItem>*/}
        {/*  <Button size="xs">Docs</Button>*/}
        {/*</PlusGridItem>*/}
        {/*<PlusGridItem>*/}
        {/*  <Button size="xs">Pricing</Button>*/}
        {/*</PlusGridItem>*/}
        <PlusGridItem>
          <Button size="xs">
            <Link to="ROUTE:COMPONENT:DETAILS" params={{ key: 'switch' }}>
              Components
            </Link>
          </Button>
        </PlusGridItem>
        {/*<PlusGridItem>*/}
        {/*  <Button size="xs">Version 1.2.7 (current)</Button>*/}
        {/*</PlusGridItem>*/}
        <Socials />
      </PlusGrid>
    </div>
  );
};
